import React from "react";

import { BrowserRouter } from "react-router-dom";

import "./App.css";

import { Routes } from "./Routes";
import { Nav } from "./Nav";

function App() {
  return (
    <BrowserRouter>
      <div className="App">
        <Nav />
        <Routes />
      </div>
    </BrowserRouter>
  );
}

export default App;
